webpackJsonp([0x715242d7fd6a],{5925:function(e,t){e.exports={data:{post:{html:'<p>It seems <a href="http://radio.weblogs.com/0103021/2003/03/12.html#a824">everyone</a> <a href="http://www.schockwellenreiter.de/2003/03/12.html#00857">and</a> <a href="http://radio.weblogs.com/0001011/2003/03/10.html#a2466">his</a> <a href="http://www.instapundit.com/archives/008080.php#008080">brother</a> <a href="http://slashdot.org/articles/03/03/11/135255.shtml?tid=187">has</a> mentioned that <a title="Yahoo! News - McDonald\'s to Offer Wireless Internet" href="http://story.news.yahoo.com/news?tmpl=story&u=/ap/20030311/ap_on_hi_te/mcdonalds_intel">McDonald\'s is to Offer Wireless Internet</a>. But does anyone read the fine print? The press release did not come from McDonald\'s, but from their <a href="http://www.cometanetworks.com/launch.html">wireless provider</a>. This is a 3 month trial program. In 10 restaurants. Out of 20000. At a company that tests a hamburger for years before they roll it out. Do the math.</p>',fields:{title:"Everywhere Overnight",date:"12 Mar 2003",url:"https://papascott.de/2003-03-12-everywhere-overnight/"}}},pathContext:{slug:"/2003-03-12-everywhere-overnight/",prev:{fields:{title:"Gonzo Gardening",date:"10 Mar 2003",slug:"/2003-03-10-gonzo-gardening/"}},next:{fields:{title:"Illegal Exports",date:"12 Mar 2003",slug:"/2003-03-12-illegal-exports/"}}}}}});
